!---------------- Mss  -----------------	double precision function MssH(A1vL,A1vR,A1sL,A1sR,PvL,PvR,PsL,PsR,FvL,FvR,FsL,FsR,A1Lc,A1Rc,FLc,FRc,mq1,mq1c,wquark)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq1,mq1c,wquark	double complex A1vL,A1vR,A1sL,A1sR,PvL,PvR,PsL,PsR,FvL,FvR,FsL,FsR,A1Lc,A1Rc,FLc,FRc			MssH = 0d0	MssH = dreal(-((A1Lc*(A1sR*FRc*FsR*m1**3*PsR + A1vR*FRc*FsR*m1**4*PsR + A1sR*FRc*FsR*m1*m2**2*PsR - A1vR*FRc*FsR*m2**4*PsR + 2*A1sR*FRc*FsR*m1*m3**2*PsR +     &         2*A1vR*FRc*FsR*m1**2*m3**2*PsR - 2*A1vR*FRc*FsR*m2**2*m3**2*PsR + A1sR*FLc*FvL*m1**3*mq1c*PsR + A1sR*FLc*FvL*m1*m2**2*mq1c*PsR +      &         2*A1sR*FLc*FsR*m1*m3*mq1c*PsR + A1vR*FLc*FsR*m1**2*m3*mq1c*PsR - A1vR*FLc*FsR*m2**2*m3*mq1c*PsR + 2*A1sR*FLc*FvL*m1*m3**2*mq1c*PsR +      &         A1sR*FLc*FsL*m1**3*mq1c*PvL + A1sR*FLc*FsL*m1*m2**2*mq1c*PvL + 2*A1sR*FLc*FsL*m1*m3**2*mq1c*PvL + A1vR*FRc*FsR*m2**2*PsR*sman +      &         2*A1sR*FRc*FvL*m1*m3*PsR*sman + A1vR*FRc*FvL*m1**2*m3*PsR*sman - A1vR*FRc*FvL*m2**2*m3*PsR*sman + A1vR*FRc*FsR*m3**2*PsR*sman +      &         A1vR*FLc*FvL*m1**2*mq1c*PsR*sman + A1vR*FLc*FsR*m3*mq1c*PsR*sman + A1vR*FLc*FvL*m3**2*mq1c*PsR*sman + A1sR*FRc*FvR*m1**3*PvL*sman +      &         A1vR*FRc*FvR*m1**4*PvL*sman + A1sR*FRc*FvR*m1*m2**2*PvL*sman - A1vR*FRc*FvR*m2**4*PvL*sman + 2*A1sR*FRc*FsL*m1*m3*PvL*sman +      &         A1vR*FRc*FsL*m1**2*m3*PvL*sman - A1vR*FRc*FsL*m2**2*m3*PvL*sman + 2*A1sR*FRc*FvR*m1*m3**2*PvL*sman + 2*A1vR*FRc*FvR*m1**2*m3**2*PvL*sman -      &         2*A1vR*FRc*FvR*m2**2*m3**2*PvL*sman + A1vR*FLc*FsL*m1**2*mq1c*PvL*sman + 2*A1sR*FLc*FvR*m1*m3*mq1c*PvL*sman +      &         A1vR*FLc*FvR*m1**2*m3*mq1c*PvL*sman - A1vR*FLc*FvR*m2**2*m3*mq1c*PvL*sman + A1vR*FLc*FsL*m3**2*mq1c*PvL*sman + A1vR*FRc*FvL*m3*PsR*sman**2 +      &         A1vR*FRc*FvR*m2**2*PvL*sman**2 + A1vR*FRc*FsL*m3*PvL*sman**2 + A1vR*FRc*FvR*m3**2*PvL*sman**2 + A1vR*FLc*FvR*m3*mq1c*PvL*sman**2 -      &         A1sR*FRc*FsR*m1*PsR*tman - A1vR*FRc*FsR*m1**2*PsR*tman + A1vR*FRc*FsR*m2**2*PsR*tman - A1sR*FLc*FvL*m1*mq1c*PsR*tman -      &         A1sR*FLc*FsL*m1*mq1c*PvL*tman - A1vR*FLc*FvL*mq1c*PsR*sman*tman - A1sR*FRc*FvR*m1*PvL*sman*tman - A1vR*FRc*FvR*m1**2*PvL*sman*tman +      &         A1vR*FRc*FvR*m2**2*PvL*sman*tman - A1vR*FLc*FsL*mq1c*PvL*sman*tman +      &         A1vL*m1*(FLc*mq1c*(sman*(2*FvR*m3*PsL + PvR*(2*FsR*m3 + FvL*(m1**2 + m2**2 + 2*m3**2 - tman - uman))) +      &               FsL*PsL*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) +      &            FRc*sman*(2*FsL*m3*PsL + PvR*(2*FvL*m3*sman + FsR*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) +      &               FvR*PsL*(m1**2 + m2**2 + 2*m3**2 - tman - uman))) -      &         (A1vR*FRc*(m1**2 - m2**2 + sman)*(FsR*PsR + FvR*PvL*sman) + A1sR*m1*(FRc*FsR*PsR + FLc*FvL*mq1c*PsR + FLc*FsL*mq1c*PvL + FRc*FvR*PvL*sman))*     &          uman + A1sL*(FLc*mq1c*(FvR*m3*PsL*(m1**2 - m2**2 + sman) + PvR*(FsR*m3*(m1**2 - m2**2 + sman) + FvL*sman*(m1**2 + m3**2 - tman)) +      &               FsL*PsL*(m1**2 + m3**2 - tman)) + FRc*(FsL*m3*PsL*(m1**2 - m2**2 + sman) +      &               FvR*PsL*(m1**4 - m2**4 + m2**2*sman + m3**2*(2*m1**2 - 2*m2**2 + sman) + m2**2*tman + m2**2*uman - sman*uman - m1**2*(tman + uman)) +      &               PvR*(FvL*m3*sman*(m1**2 - m2**2 + sman) + FsR*     &                   (m1**4 - m2**4 + m2**2*sman + m3**2*(2*m1**2 - 2*m2**2 + sman) + m2**2*tman + m2**2*uman - sman*uman - m1**2*(tman + uman)))))) +      &      A1Rc*(A1sR*FLc*FvL*m1**4*PsR - A1sR*FLc*FvL*m2**4*PsR + A1sR*FLc*FsR*m1**2*m3*PsR - A1sR*FLc*FsR*m2**2*m3*PsR + 2*A1sR*FLc*FvL*m1**2*m3**2*PsR -      &         2*A1sR*FLc*FvL*m2**2*m3**2*PsR + A1sR*FRc*FsR*m1**2*mq1c*PsR + A1vR*FRc*FsR*m1**3*mq1c*PsR + A1vR*FRc*FsR*m1*m2**2*mq1c*PsR +      &         A1sR*FRc*FvL*m1**2*m3*mq1c*PsR - A1sR*FRc*FvL*m2**2*m3*mq1c*PsR + A1sR*FRc*FsR*m3**2*mq1c*PsR + 2*A1vR*FRc*FsR*m1*m3**2*mq1c*PsR +      &         A1sR*FLc*FsL*m1**4*PvL - A1sR*FLc*FsL*m2**4*PvL + 2*A1sR*FLc*FsL*m1**2*m3**2*PvL - 2*A1sR*FLc*FsL*m2**2*m3**2*PvL +      &         A1sR*FRc*FsL*m1**2*m3*mq1c*PvL - A1sR*FRc*FsL*m2**2*m3*mq1c*PvL + A1vR*FLc*FvL*m1**3*PsR*sman + A1sR*FLc*FvL*m2**2*PsR*sman +      &         A1vR*FLc*FvL*m1*m2**2*PsR*sman + A1sR*FLc*FsR*m3*PsR*sman + 2*A1vR*FLc*FsR*m1*m3*PsR*sman + A1sR*FLc*FvL*m3**2*PsR*sman +      &         2*A1vR*FLc*FvL*m1*m3**2*PsR*sman + A1sR*FRc*FvL*m3*mq1c*PsR*sman + 2*A1vR*FRc*FvL*m1*m3*mq1c*PsR*sman + A1vR*FLc*FsL*m1**3*PvL*sman +      &         A1sR*FLc*FsL*m2**2*PvL*sman + A1vR*FLc*FsL*m1*m2**2*PvL*sman + A1sR*FLc*FvR*m1**2*m3*PvL*sman - A1sR*FLc*FvR*m2**2*m3*PvL*sman +      &         A1sR*FLc*FsL*m3**2*PvL*sman + 2*A1vR*FLc*FsL*m1*m3**2*PvL*sman + A1sR*FRc*FvR*m1**2*mq1c*PvL*sman + A1vR*FRc*FvR*m1**3*mq1c*PvL*sman +      &         A1vR*FRc*FvR*m1*m2**2*mq1c*PvL*sman + A1sR*FRc*FsL*m3*mq1c*PvL*sman + 2*A1vR*FRc*FsL*m1*m3*mq1c*PvL*sman + A1sR*FRc*FvR*m3**2*mq1c*PvL*sman +      &         2*A1vR*FRc*FvR*m1*m3**2*mq1c*PvL*sman + A1sR*FLc*FvR*m3*PvL*sman**2 + 2*A1vR*FLc*FvR*m1*m3*PvL*sman**2 - A1sR*FLc*FvL*m1**2*PsR*tman +      &         A1sR*FLc*FvL*m2**2*PsR*tman - A1sR*FRc*FsR*mq1c*PsR*tman - A1vR*FRc*FsR*m1*mq1c*PsR*tman - A1sR*FLc*FsL*m1**2*PvL*tman +      &         A1sR*FLc*FsL*m2**2*PvL*tman - A1vR*FLc*FvL*m1*PsR*sman*tman - A1vR*FLc*FsL*m1*PvL*sman*tman - A1sR*FRc*FvR*mq1c*PvL*sman*tman -      &         A1vR*FRc*FvR*m1*mq1c*PvL*sman*tman + A1sL*m1*(FLc*     &             (sman*(2*FvR*m3*PsL + PvR*(2*FsR*m3 + FvL*(m1**2 + m2**2 + 2*m3**2 - tman - uman))) + FsL*PsL*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) +      &            FRc*mq1c*(2*FsL*m3*PsL + PvR*(2*FvL*m3*sman + FsR*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) +      &               FvR*PsL*(m1**2 + m2**2 + 2*m3**2 - tman - uman))) -      &         (A1sR*FLc*(FvL*PsR + FsL*PvL)*(m1**2 - m2**2 + sman) + A1vR*m1*(FLc*(FvL*PsR + FsL*PvL)*sman + FRc*mq1c*(FsR*PsR + FvR*PvL*sman)))*uman +      &         A1vL*(FRc*mq1c*(FsL*m3*PsL*(m1**2 - m2**2 + sman) +      &               sman*(PvR*(FvL*m3*(m1**2 - m2**2 + sman) + FsR*(m1**2 + m3**2 - tman)) + FvR*PsL*(m1**2 + m3**2 - tman))) +      &            FLc*(FsL*PsL*(m1**4 - m2**4 + m2**2*sman + m3**2*(2*m1**2 - 2*m2**2 + sman) + m2**2*tman + m2**2*uman - sman*uman - m1**2*(tman + uman)) +      &               sman*(FvR*m3*PsL*(m1**2 - m2**2 + sman) + PvR*     &                   (FsR*m3*(m1**2 - m2**2 + sman) + FvL*(m1**4 - m2**4 + m2**2*sman + m3**2*(2*m1**2 - 2*m2**2 + sman) + m2**2*tman + m2**2*uman -      &                        sman*uman - m1**2*(tman + uman))))))))/((mq1**2 - sman + (cI*mq1*wquark))*(-mq1c**2 + sman + (cI*mq1c*wquark)))))      	end 	!---------------- Mtt  ----------------	double precision function MttH(A2sL,A2sR,P,Gscalar,A2Lc,A2Rc,Gc,mq2,mq2c)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq2,mq2c	double complex A2sL,A2sR,P,Gscalar,A2Lc,A2Rc,Gc		 	MttH = 0d0	MttH = dreal(-((Gc*Gscalar*P*(A2Lc*(2*A2sR*m1*m3 + A2sL*(m1**2 + m3**2 - tman)) + A2Rc*(2*A2sL*m1*m3 + A2sR*(m1**2 + m3**2 - tman))))/((mq2**2 - tman)*(-mq2c**2 + tman))))	 	end				!---------------- Muu  ----------------	double precision function MuuH(A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A3Lc,A3Rc,HLc,HRc,mq3,mq3c)		implicit none 	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq3,mq3c	double complex A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A3Lc,A3Rc,HLc,HRc		MuuH = 0d0	MuuH = dreal((A3Rc*(-(A3vR*HLc*HtreeL*m1**4*mq3) - 2*A3vR*HLc*HtreeL*m1**2*m3**2*mq3 + 2*A3vR*HLc*HtreeL*m3**2*m4**2*mq3 +     &       A3vR*HLc*HtreeL*m4**4*mq3 - A3vR*HRc*HtreeL*m1**3*mq3*mq3c - A3vL*HRc*HtreeR*m1**2*m3*mq3*mq3c -      &       2*A3vR*HRc*HtreeL*m1*m3**2*mq3*mq3c - A3vR*HRc*HtreeL*m1*m4**2*mq3*mq3c + A3vL*HRc*HtreeR*m3*m4**2*mq3*mq3c +      &       A3vR*HLc*HtreeL*m1**2*mq3*sman - A3vR*HLc*HtreeL*m4**2*mq3*sman + A3vR*HRc*HtreeL*m1*mq3*mq3c*sman +      &       A3vR*HLc*HtreeL*m1**2*mq3*tman - A3vR*HLc*HtreeL*m4**2*mq3*tman + A3vR*HRc*HtreeL*m1*mq3*mq3c*tman -      &       (A3vL*m3*(HtreeR*mq3*(2*HLc*m1 + HRc*mq3c) + HtreeL*(HLc*m1**2 - HLc*m4**2 + 2*HRc*m1*mq3c)) +      &          A3vR*(HLc*(HtreeL*mq3*(m3**2 + m4**2 - sman) + HtreeR*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &             HRc*HtreeR*mq3c*(m1**2 + m3**2 - tman)))*uman - A3vL*HLc*HtreeL*m3*uman**2 +      &       A3sR*(-(HtreeR*mq3*(HRc*mq3c*(m1**2 + m3**2 - tman) + HLc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman))) +      &          HtreeL*(HLc*(-m1 + m4)*(m1 + m4) - HRc*m1*mq3c)*(m1**2 + 2*m3**2 + m4**2 - sman - tman) -      &          HLc*HtreeL*(m3**2 + m4**2 - sman)*uman) +      &       A3sL*m3*(HRc*HtreeR*(-m1 + m4)*(m1 + m4)*mq3c - HtreeR*(2*HLc*m1 + HRc*mq3c)*uman -      &          HtreeL*mq3*(2*HRc*m1*mq3c + HLc*(m1**2 - m4**2 + uman)))) +      &    A3Lc*(-(A3vL*HRc*HtreeR*m1**4*mq3) - 2*A3vL*HRc*HtreeR*m1**2*m3**2*mq3 + 2*A3vL*HRc*HtreeR*m3**2*m4**2*mq3 +      &       A3vL*HRc*HtreeR*m4**4*mq3 - A3vL*HLc*HtreeR*m1**3*mq3*mq3c - A3vR*HLc*HtreeL*m1**2*m3*mq3*mq3c -      &       2*A3vL*HLc*HtreeR*m1*m3**2*mq3*mq3c - A3vL*HLc*HtreeR*m1*m4**2*mq3*mq3c + A3vR*HLc*HtreeL*m3*m4**2*mq3*mq3c +      &       A3vL*HRc*HtreeR*m1**2*mq3*sman - A3vL*HRc*HtreeR*m4**2*mq3*sman + A3vL*HLc*HtreeR*m1*mq3*mq3c*sman +      &       A3vL*HRc*HtreeR*m1**2*mq3*tman - A3vL*HRc*HtreeR*m4**2*mq3*tman + A3vL*HLc*HtreeR*m1*mq3*mq3c*tman -      &       (A3vR*m3*(HtreeL*mq3*(2*HRc*m1 + HLc*mq3c) + HtreeR*(HRc*m1**2 - HRc*m4**2 + 2*HLc*m1*mq3c)) +      &          A3vL*(HRc*HtreeR*mq3*(m3**2 + m4**2 - sman) +      &             HtreeL*(HLc*mq3c*(m1**2 + m3**2 - tman) + HRc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman))))*uman -      &       A3vR*HRc*HtreeR*m3*uman**2 + A3sL*(-(HtreeL*mq3*     &             (HLc*mq3c*(m1**2 + m3**2 - tman) + HRc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman))) +      &          HtreeR*(HRc*(-m1 + m4)*(m1 + m4) - HLc*m1*mq3c)*(m1**2 + 2*m3**2 + m4**2 - sman - tman) -      &          HRc*HtreeR*(m3**2 + m4**2 - sman)*uman) +      &       A3sR*m3*(HLc*HtreeL*(-m1 + m4)*(m1 + m4)*mq3c - HtreeL*(2*HRc*m1 + HLc*mq3c)*uman -      &          HtreeR*mq3*(2*HLc*m1*mq3c + HRc*(m1**2 - m4**2 + uman)))))/((mq3**2 - uman)*(-mq3c**2 + uman)))        end		!---------------- Mts  ----------------	double precision function MtsH(A2sL,A2sR,P,Gscalar,A1Lc,A1Rc,FLc,FRc,mq2,mq1c,wquark)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq2,mq1c,wquark	double complex A2sL,A2sR,P,Gscalar,A1Lc,A1Rc,FLc,FRc	double complex DenQuark,DenQuarkX!	print *,"P",P		DenQuarkX = (sman - mq1c**2) - cI*mq1c*wquark!	DenQuarkX = DenQuark*dconjg(DenQuark)/(sman - mq1c**2)			MtsH = 0d0	MtsH = dreal((Gscalar*P*(A1Rc*(2d0*A2sR*FLc*m1**2*m3 - 2d0*A2sR*FLc*m2**2*m3 + 2d0*A2sR*FRc*m1**2*mq1c + 2d0*A2sR*FRc*m3**2*mq1c + 2d0*A2sR*FLc*m3*sman -     &         2d0*A2sR*FRc*mq1c*tman + 2d0*A2sL*m1*(2d0*FRc*m3*mq1c + FLc*(m1**2 + m2**2 + 2d0*m3**2 - tman - uman))) +      &      A1Lc*(2d0*A2sL*FRc*m1**2*m3 - 2d0*A2sL*FRc*m2**2*m3 + 2d0*A2sL*FLc*m1**2*mq1c + 2d0*A2sL*FLc*m3**2*mq1c + 2d0*A2sL*FRc*m3*sman -      &         2d0*A2sL*FLc*mq1c*tman + 2d0*A2sR*m1*(2d0*FLc*m3*mq1c + FRc*(m1**2 + m2**2 + 2d0*m3**2 - tman - uman)))))/     &  (2d0*(-DenQuarkX)*(mq2**2 - tman)))		end				!---------------- Mst  ----------------	double precision function MstH(A1vL,A1vR,A1sL,A1sR,PvL,PvR,PsL,PsR,FvL,FvR,FsL,FsR,A2Lc,A2Rc,Gc,mq1,mq2c,wquark)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq1,mq2c,wquark	double complex A1vL,A1vR,A1sL,A1sR,PvL,PvR,PsL,PsR,FvL,FvR,FsL,FsR,A2Lc,A2Rc,Gc	double complex DenQuark,DenQuarkX		DenQuarkX = (sman - mq1**2) + cI*mq1*wquark!	DenQuarkX = DenQuark*dconjg(DenQuark)/(sman - mq1**2)			MstH = 0d0	MstH = dreal((Gc*(A1sR*A2Rc*FsR*m1**2*PsR + A1vR*A2Rc*FsR*m1**3*PsR + A1sR*A2Lc*FvL*m1**3*