3**2*(4*m1**2 + sman - tman + uman) + m4**2*(2*m1**2 - 2*m2**2 + sman - tman + uman))))))))/     &  (2.*(-DenQuarkX)*(mq3c**2 - uman)))		end					!---------------- Mus  ----------------	double precision function MusH(A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A1Lc,A1Rc,FLc,FRc,mq3,mq1c,wquark)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq3,mq1c,wquark	double complex A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A1Lc,A1Rc,FLc,FRc	double complex DenQuark,DenQuarkX		DenQuarkX = (sman - mq1c**2) - cI*mq1c*wquark!	DenQuarkX = DenQuark*dconjg(DenQuark)/(sman - mq1c**2)			MusH = 0d0	MusH = dreal((A1Lc*(2*A3vR*FRc*HtreeL*m1**4*mq3 + 2*A3vR*FRc*HtreeL*m1**2*m2**2*mq3 - 4*A3vL*FRc*HtreeR*m1*m2**2*m3*mq3 +     &       4*A3vR*FRc*HtreeL*m1**2*m3**2*mq3 + 2*A3vR*FRc*HtreeL*m1**2*m4**2*mq3 - 2*A3vR*FRc*HtreeL*m2**2*m4**2*mq3 -      &       4*A3vL*FRc*HtreeR*m1*m3*m4**2*mq3 + 2*A3vL*FLc*HtreeR*m1**3*mq1c*mq3 + 2*A3vR*FLc*HtreeL*m1**2*m3*mq1c*mq3 +      &       4*A3vL*FLc*HtreeR*m1*m3**2*mq1c*mq3 + 2*A3vL*FLc*HtreeR*m1*m4**2*mq1c*mq3 - 2*A3vR*FLc*HtreeL*m3*m4**2*mq1c*mq3 -      &       A3vR*FRc*HtreeL*m1**2*mq3*sman + A3vR*FRc*HtreeL*m2**2*mq3*sman + 2*A3vL*FRc*HtreeR*m1*m3*mq3*sman +      &       A3vR*FRc*HtreeL*m3**2*mq3*sman + A3vR*FRc*HtreeL*m4**2*mq3*sman - 2*A3vL*FLc*HtreeR*m1*mq1c*mq3*sman -      &       A3vR*FRc*HtreeL*mq3*sman**2 - 3*A3vR*FRc*HtreeL*m1**2*mq3*tman - A3vR*FRc*HtreeL*m2**2*mq3*tman +      &       2*A3vL*FRc*HtreeR*m1*m3*mq3*tman - A3vR*FRc*HtreeL*m3**2*mq3*tman - A3vR*FRc*HtreeL*m4**2*mq3*tman -      &       2*A3vL*FLc*HtreeR*m1*mq1c*mq3*tman + A3vR*FRc*HtreeL*mq3*tman**2 +      &       (A3vR*(2*FLc*m3*mq1c*(2*HtreeR*m1 + HtreeL*mq3) +      &             FRc*(HtreeL*(-m1**2 + m2**2 + m3**2 + m4**2)*mq3 + 2*HtreeR*m1*(m1**2 + m2**2 + 2*m3**2 - tman))) +      &          2*A3vL*(FRc*m3*(HtreeR*m1*mq3 + HtreeL*(m1**2 - m2**2 + sman)) + FLc*HtreeL*mq1c*(m1**2 + m3**2 - tman)))*uman -      &       A3vR*FRc*(2*HtreeR*m1 + HtreeL*mq3)*uman**2 +      &       2*A3sL*(FLc*mq1c*(HtreeL*mq3*(m1**2 + m3**2 - tman) + HtreeR*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &          FRc*m3*(HtreeL*mq3*(m1**2 - m2**2 + sman) + HtreeR*m1*(-2*m2**2 - 2*m4**2 + sman + tman + uman))) +      &       A3sR*(2*FLc*m3*mq1c*(2*HtreeR*m1*mq3 + HtreeL*(m1**2 - m4**2 + uman)) +      &          FRc*(2*HtreeR*m1*mq3*(m1**2 + m2**2 + 2*m3**2 - tman - uman) +      &             HtreeL*((m1**2 + m2**2 - sman - tman)*(2*m1**2 + sman - tman) + (-m1**2 + m2**2)*uman - uman**2 +      &                m3**2*(4*m1**2 + sman - tman + uman) + m4**2*(2*m1**2 - 2*m2**2 + sman - tman + uman))))) +      &    A1Rc*(2*A3vL*FLc*HtreeR*m1**4*mq3 + 2*A3vL*FLc*HtreeR*m1**2*m2**2*mq3 - 4*A3vR*FLc*HtreeL*m1*m2**2*m3*mq3 +      &       4*A3vL*FLc*HtreeR*m1**2*m3**2*mq3 + 2*A3vL*FLc*HtreeR*m1**2*m4**2*mq3 - 2*A3vL*FLc*HtreeR*m2**2*m4**2*mq3 -      &       4*A3vR*FLc*HtreeL*m1*m3*m4**2*mq3 + 2*A3vR*FRc*HtreeL*m1**3*mq1c*mq3 + 2*A3vL*FRc*HtreeR*m1**2*m3*mq1c*mq3 +      &       4*A3vR*FRc*HtreeL*m1*m3**2*mq1c*mq3 + 2*A3vR*FRc*HtreeL*m1*m4**2*mq1c*mq3 - 2*A3vL*FRc*HtreeR*m3*m4**2*mq1c*mq3 -      &       A3vL*FLc*HtreeR*m1**2*mq3*sman + A3vL*FLc*HtreeR*m2**2*mq3*sman + 2*A3vR*FLc*HtreeL*m1*m3*mq3*sman +      &       A3vL*FLc*HtreeR*m3**2*mq3*sman + A3vL*FLc*HtreeR*m4**2*mq3*sman - 2*A3vR*FRc*HtreeL*m1*mq1c*mq3*sman -      &       A3vL*FLc*HtreeR*mq3*sman**2 - 3*A3vL*FLc*HtreeR*m1**2*mq3*tman - A3vL*FLc*HtreeR*m2**2*mq3*tman +      &       2*A3vR*FLc*HtreeL*m1*m3*mq3*tman - A3vL*FLc*HtreeR*m3**2*mq3*tman - A3vL*FLc*HtreeR*m4**2*mq3*tman -      &       2*A3vR*FRc*HtreeL*m1*mq1c*mq3*tman + A3vL*FLc*HtreeR*mq3*tman**2 +      &       (A3vL*(2*FRc*m3*mq1c*(2*HtreeL*m1 + HtreeR*mq3) +      &             FLc*(HtreeR*(-m1**2 + m2**2 + m3**2 + m4**2)*mq3 + 2*HtreeL*m1*(m1**2 + m2**2 + 2*m3**2 - tman))) +      &          2*A3vR*(FLc*m3*(HtreeL*m1*mq3 + HtreeR*(m1**2 - m2**2 + sman)) + FRc*HtreeR*mq1c*(m1**2 + m3**2 - tman)))*uman -      &       A3vL*FLc*(2*HtreeL*m1 + HtreeR*mq3)*uman**2 +      &       2*A3sR*(FRc*mq1c*(HtreeR*mq3*(m1**2 + m3**2 - tman) + HtreeL*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &          FLc*m3*(HtreeR*mq3*(m1**2 - m2**2 + sman) + HtreeL*m1*(-2*m2**2 - 2*m4**2 + sman + tman + uman))) +      &       A3sL*(2*FRc*m3*mq1c*(2*HtreeL*m1*mq3 + HtreeR*(m1**2 - m4**2 + uman)) +      &          FLc*(2*HtreeL*m1*mq3*(m1**2 + m2**2 + 2*m3**2 - tman - uman) +      &             HtreeR*((m1**2 + m2**2 - sman - tman)*(2*m1**2 + sman - tman) + (-m1**2 + m2**2)*uman - uman**2 +      &                m3**2*(4*m1**2 + sman - tman + uman) + m4**2*(2*m1**2 - 2*m2**2 + sman - tman + uman))))))/     &  (2.*(-DenQuarkX)*(mq3**2 - uman)))		end				!---------------- Mtu----------------	double precision function MtuH(A2sL,A2sR,P,Gscalar,A3Lc,A3Rc,HLc,HRc,mq2,mq3c)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq2,mq3c	double complex A2sL,A2sR,P,Gscalar,A3Lc,A3Rc,HLc,HRc			MtuH = 0d0	MtuH = dreal((Gscalar*P*(2*A2sL*(A3Lc*(HLc*mq3c*(m1**2 + m3**2 - tman) + HRc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +     &         A3Rc*m3*(2*HRc*m1*mq3c + HLc*(m1**2 - m4**2 + uman))) +      &      2*A2sR*(A3Rc*(HRc*mq3c*(m1**2 + m3**2 - tman) + HLc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &         A3Lc*m3*(2*HLc*m1*mq3c + HRc*(m1**2 - m4**2 + uman)))))/(2.*(mq2**2 - tman)*(mq3c**2 - uman)))		end				!---------------- Mut  ----------------	double precision function MutH(A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A2Lc,A2Rc,Gc,mq3,mq2c)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq3,mq2c	double complex A3vL,A3vR,A3sL,A3sR,HtreeL,HtreeR,A2Lc,A2Rc,Gc			MutH = 0d0	MutH = dreal((Gc*(A2Lc*(A3sL*(HtreeL*mq3*(m1**2 + m3**2 - tman) + HtreeR*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +     &         mq3*(A3vR*HtreeL*m3*(m1**2 - m4**2) + A3vL*HtreeR*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &         (A3vR*m3*(2*HtreeR*m1 + HtreeL*mq3) + A3vL*HtreeL*(m1**2 + m3**2 - tman))*uman +      &         A3sR*m3*(2*HtreeR*m1*mq3 + HtreeL*(m1**2 - m4**2 + uman))) +      &      A2Rc*(A3sR*(HtreeR*mq3*(m1**2 + m3**2 - tman) + HtreeL*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &         mq3*(A3vL*HtreeR*m3*(m1**2 - m4**2) + A3vR*HtreeL*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) +      &         (A3vL*m3*(2*HtreeL*m1 + HtreeR*mq3) + A3vR*HtreeR*(m1**2 + m3**2 - tman))*uman +      &         A3sL*m3*(2*HtreeL*m1*mq3 + HtreeR*(m1**2 - m4**2 + uman)))))/((mq2c**2 - tman)*(mq3**2 - uman)))		end